import './card.css';

function Card() {
  return (
    <div className="cards">
      <div className="header_cards">
        <span>17 de ago, 2024</span>
        <img src="./heart_filled.svg" alt="" />
      </div>
      <h1>O que é linguagem de programação? Conheça as principais</h1>
      <p>Uma das mais populares vertentes da tecnologia da informação, a área de programação 
        segue tendo muita demanda de trabalho justamente pela velocidade com que dispositivos 
        tecnológicos vêm avançando.
      </p>
  </div>
  );
}

export default Card;
